/*Data for the table `seats` */

SELECT s.studio_id, r.row_letter, n.seat_number, 'available'
FROM `studios` s
CROSS JOIN (
  SELECT 'A' AS row_letter UNION ALL SELECT 'B' UNION ALL SELECT 'C' UNION ALL SELECT 'D'
) r
CROSS JOIN (
  SELECT 1 AS seat_number UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8
) n
ORDER BY s.studio_id, r.row_letter, n.seat_number;

